import PropTypes from 'prop-types';
import React from 'react';
import { connect } from 'react-redux';

const INITIAL_VALUE = 0;

class Wallet extends React.Component {
  render() {
    const { user } = this.props;
    return (
      <>
        <div>
          <h1>TrybeWallet</h1>
          <h3 data-testid="email-field">{`Email: ${user.email}`}</h3>
          <h3 data-testid="total-field">{`Total: ${INITIAL_VALUE}`}</h3>
          <h3 data-testid="header-currency-field">BRL</h3>
        </div>
        <div>
          <h3 data-testid="value-input">Valor da despesa</h3>
          <h3 data-testid="description-input">Descrição da despesa</h3>
          <h3 data-testid="currency-input"> Moeda registrada</h3>
          <label
            data-testid="method-input"
            htmlFor="pagamento"
          >
            Método de pagamento
            <select name="pagamento" id="pagamento">
              <option value="dinheiro">Dinheiro</option>
              <option value="cartao-de-credito">Cartão de Crédito</option>
              <option value="cartao-de-debito">Cartão de Débito</option>
            </select>
          </label>
        </div>
      </>
    );
  }
}

const mapStateToProps = (state) => ({
  user: state.user,
});

export default connect(mapStateToProps)(Wallet);

Wallet.propTypes = {
  user: PropTypes.shape({
    email: PropTypes.string.isRequired,
  }).isRequired,
};
